import React from 'react';
import { Routes, Route } from 'react-router-dom';
import './Unit.css';

function Unit({ unit }){
    const topics = [
        ['Types of Variables', 'Converting Categorical Data into Numeric Data'],
        ['K-Means', 'Principal Component Analysis (PCA)']
    ];
    const subUnitList = topics.map((list, unitIndex) => <Route path={`/unit${unitIndex + 1}`} element={<Unit unit={unitIndex + 1} subUnitList={list.map((title, subUnitIndex) => <li><CustomLink to={`/unit${unitIndex + 1}/${subUnitIndex + 1}`} className='subunit'>{title}</CustomLink></li>)} />}></Route>);
    const subUnitRoutes = topics.map((list, unitIndex) => <Routes>{list.map((title, subUnitIndex) => <Route path={`/unit${unitIndex + 1}/${subUnitIndex + 1}`} element={<Page unit={unitIndex + 1} index={subUnitIndex + 1} />}></Route>)}</Routes>);
    return (
        <div className={`unit${unit}`}>
            <h2>Unit {unit}</h2>
            <ul>{subUnitList}</ul>
        </div>
    );
};
export default Unit;
